        // Function to create markers
        cityMarkersData.forEach(function(cityData) {
            var marker = L.circleMarker([cityData.lat, cityData.lng], {
                radius: 5,
                color: 'blue',
                fillColor: 'blue',
                fillOpacity: 0.5
            }).addTo(map);

            marker.bindPopup('<b>' + cityData.city + '</b><br>Click to see drone paths.');

            marker.on('click', function() {
                // Clear existing drone paths
                if (window.currentDronePaths) {
                    window.currentDronePaths.forEach(function(path) {
                        map.removeLayer(path);
                    });
                }
                window.currentDronePaths = [];

                // For each group that includes this city, draw its path
                cityData.groups.forEach(function(groupIndex) {
                    var groupPathData = groupPathsData[groupIndex];
                    if (groupPathData) {
                        var polyline = L.polyline(groupPathData.pathCoords, {color: 'red'}).addTo(map);
                        polyline.bindPopup('Alert from ' + new Date(groupPathData.startTime).toLocaleString() +
                            ' to ' + new Date(groupPathData.endTime).toLocaleString());
                        window.currentDronePaths.push(polyline);
                    }
                });
            });
        });
